class AffiliateBeautifier{constructor(){this.switchAll(),this.eventClick()}eventClick(){["mousedown","touchstart"].forEach(t=>{document.querySelectorAll("a[data-href]").forEach(e=>{e.addEventListener(t,t=>{this.switch(t.target)})})})}switchAll(){document.querySelectorAll("a[data-href]").forEach(t=>{this.switch(t)})}switch(t){let e=t.getAttribute("href"),a=t.dataset.href;t.setAttribute("href",a),t.dataset.href=e}}document.addEventListener("DOMContentLoaded",()=>{new AffiliateBeautifier});